query busArrival ($busStopCode: String!) {
    busArrival (busStopCode: $busStopCode) {
        busStopCode
        services {
            busNumber
            operator
            nextBus {
                estimatedArrival
                latitude
                longitude
                load
                feature
                type
            }
        }
    }
}

